<script>
  export default {
    data() {
      return {
        showCollapseKey: false,
        showCollapseKonf: false,
        stateConf: 'err',


        percentages: 0,
        sreenHeight: window.innerHeight,
        rocketHeight: 165,
        currentRocketPosition: -5,
      }
    },
    methods: {
      setHeight() {
        this.sreenHeight = window.innerHeight;
      },
      setRocketPosition() {
        this.currentRocketPosition = this.sreenHeight / 100 * (this.percentages === 100 ? this.percentages + 25 : this.percentages) + 25;
      },
      removeRocketUp() {
        let rocketUp = document.querySelector('.addConf-rocket');
        if (this.percentages === 0) {
          rocketUp.classList.add('rocketUp');
          if (rocketUp.classList.contains('rocketUp-fire')) {
            rocketUp.classList.remove('rocketUp-fire');
          }
        } else {
          rocketUp.classList.add('rocketUp-fire');
          if (rocketUp.classList.contains('rocketUp')) {
            rocketUp.classList.remove('rocketUp');
          }
        }
      }
    },
    watch: {
      percentages() {
        this.setRocketPosition();
        this.removeRocketUp()
      }
    },
    mounted() {
      window.addEventListener('resize', this.setHeight)
    }
  }
</script>

